import * as React from 'react';
import './App.css';
import Project from './Project';
import Nav from './Nav';

function App() {
  return (
    <div className="App">
      <Nav />
      <Project
        img="https://i.ebayimg.com/images/g/rkIAAOSw0mRggYOr/s-l500.jpg"
        alt="Shiba Inu Hello Kitty"
        name="Shiba Inu Hello Kitty"
       />
    </div>
  );
}

export default App;
